DROP FUNCTION IF EXISTS lapsed.update_vn();

CREATE FUNCTION lapsed.update_vn()
    RETURNS INTEGER
    LANGUAGE plpgsql
AS
$$
DECLARE
    v_pv         RECORD;
    v_2020       RECORD;
    v_2019       RECORD;
    l_count      INTEGER = 0;
    v_updated_vn RECORD;
    l_rekv_id    INTEGER;
    v_tulemus    RECORD;
    l_user_id    INTEGER;
BEGIN
    -- 1. Удалить оплату, совершенную в 2020 году, у тех детей, у кого был VN в 2019 году
    -- и его же в 2020 году присвоили новому владельцу.
    FOR v_2019 IN
        SELECT *
        FROM tmp_viitenr
        WHERE kas_2019 = '1'
          AND vn not in ('8201814')
        LOOP
            -- ищем смены в 2020
            FOR v_2020 IN
                SELECT *
                FROM tmp_viitenr
                WHERE kas_2020 = '1'
                  AND vn = v_2019.vn
                LOOP
                    -- ищем все оплаты в 2020 году
                    FOR v_pv IN
                        SELECT *
                        FROM lapsed.pank_vv pv
                        WHERE pv.viitenumber = v_2020.vn
                          AND year(pv.kpv) = 2020
                          AND pv.doc_id IS NOT NULL
                        LOOP
                            RAISE NOTICE 'deleting v_2020.vn %, maksed %', v_2020.vn, v_pv.doc_id;
                            l_user_id = (SELECT id
                                         FROM ou.userid
                                         WHERE kasutaja = 'vlad'
                                           AND rekvid IN (
                                             SELECT rekvid
                                             FROM docs.doc
                                             WHERE id = v_pv.doc_id
                                         )
                                         LIMIT 1);
                            SELECT * INTO v_tulemus FROM docs.sp_delete_mk(l_user_id, v_pv.doc_id);
                            RAISE NOTICE 'deleted %', v_tulemus;
                            l_count = l_count + 1;
                        END LOOP;
-- 2. Удалить VN у ВСЕХ ДЕТЕЙ (без учета была ли оплата), у кого он был в 2019 году, а в 2020 году присвоен новому владельцу.
                    FOR v_updated_vn IN
                        SELECT *
                        FROM lapsed.viitenr vn
                        WHERE vn.viitenumber = v_2020.vn
                        LOOP
                            RAISE NOTICE 'delete vn.id %', v_updated_vn.id;
                            DELETE FROM lapsed.viitenr WHERE id = v_updated_vn.id;
                        END LOOP;
                    -- 3. Назначить новый VN ВСЕМ ДЕТЯМ (без учета была ли оплата), кому он присвоен в 2020 году как новому владельцу (относительно 2019 года)
-- ищем учреждение
                    l_rekv_id = (SELECT id FROM ou.rekv WHERE left(nimetus, 10) = left(v_2020.asutus, 10) LIMIT 1);
                    IF l_rekv_id IS NULL
                    THEN
                        RAISE EXCEPTION 'asutus %', v_2020.asutus;
                    END IF;
                    RAISE NOTICE 'new asutus %', l_rekv_id;
                    INSERT INTO lapsed.viitenr (isikukood, rekv_id, viitenumber)
                    VALUES (v_2020.ik, l_rekv_id, v_2020.vn);
-- 4. Повторно разобрать оплату 2020 г., удаленную по п.1 с учетом новых владельцев VN в 2020 году
                    FOR v_pv IN
                        SELECT *
                        FROM lapsed.pank_vv
                        WHERE viitenumber = v_2020.vn
                          AND year(kpv) = 2020
                          AND doc_id IS NULL
                        LOOP
                            RAISE NOTICE 'loe makse %', v_pv.id;
                            l_user_id =
                                    (SELECT id FROM ou.userid WHERE kasutaja = 'vlad' AND rekvid = l_rekv_id LIMIT 1);
                            SELECT * INTO v_tulemus FROM lapsed.loe_makse(l_user_id, v_pv.id);
                            RAISE NOTICE 'loe makse tehtud %', v_tulemus;
                        END LOOP;

                END LOOP;
        END LOOP;

    RETURN l_count;

END;
$$;

SELECT lapsed.update_vn();

DROP FUNCTION IF EXISTS lapsed.update_vn();


